// import React from 'react';
function add(a,b){
    return a+b;
}

function sub(a,b){
    return a-b;
}

function mul(a,b){
    return a*b;
}

function div(a,b){
    return (a/b).toFixed(2);
}

export default 0;
export {add,sub,mul,div}
